		CREATE_EVENT_LISTENER(ItemPurchaseListener, "item_purchase");

		CREATE_EVENT_LISTENER(PlayerHurtListener, "player_hurt");

		CREATE_EVENT_LISTENER(BulletImpactListener, "bullet_impact");

		CREATE_EVENT_LISTENER(WeaponFireListener, "weapon_fire");

		CREATE_EVENT_LISTENER(RoundStartListener, "round_start");


		ItemPurchaseListener item_purchase_listener;
		PlayerHurtListener player_hurt_listener;
		BulletImpactListener bullet_impact_listener;
		WeaponFireListener weapon_fire_listener;
		RoundStartListener round_start_listener;

		void InitializeEventListeners()
		{
			
			m_pGameEventManager->AddListener(&item_purchase_listener, ("item_purchase"), false);
			m_pGameEventManager->AddListener(&player_hurt_listener, ("player_hurt"), false);
			m_pGameEventManager->AddListener(&bullet_impact_listener, ("bullet_impact"), false);
			m_pGameEventManager->AddListener(&weapon_fire_listener, ("weapon_fire"), false);
			m_pGameEventManager->AddListener(&round_start_listener, ("round_start"), false);
		
		}

		void RemoveEventListeners()
		{
			m_pGameEventManager->RemoveListener(&item_purchase_listener);
			m_pGameEventManager->RemoveListener(&player_hurt_listener);
			m_pGameEventManager->RemoveListener(&bullet_impact_listener);
			m_pGameEventManager->RemoveListener(&weapon_fire_listener);
			m_pGameEventManager->RemoveListener(&round_start_listener);
			
		}

		void ItemPurchaseListener::FireGameEvent(IGameEvent* game_event)
		{

			static float rainbow;
			static float rainbow2;
			static float rainbow3;
			static float rainbow4;
			rainbow += 0.001;
			rainbow2 += 0.005;
			rainbow3 += 0.010;
			rainbow4 += 0.015;
			if (rainbow > 1.f || rainbow2 > 1.f || rainbow3 > 1.f || rainbow4 > 1.f)
			{
				rainbow = 0.f;
				rainbow2 = 0.f;
				rainbow3 = 0.f;
				rainbow4 = 0.f;
			}

			if (!game_event)
				return;

			auto local_player = m_pEntityList->GetClientEntity(m_pEngine->GetLocalPlayer());
			if (!local_player)
				return;

			auto entity = m_pEntityList->GetClientEntity(m_pEngine->GetPlayerForUserID(game_event->GetInt("userid")));
			if (!entity)
				return;

			if (entity->GetTeamNum() == local_player->GetTeamNum())
				return;

			player_info_t player_info;
			if (!m_pEngine->GetPlayerInfo(entity->GetIndex(), &player_info))
				return;

			MISC::InGameLogger::Log log;
			
			log.color_line.PushBack("[nnware] ", Color::FromHSB(rainbow, 1.f, 1.f));
			log.color_line.PushBack(player_info.name, Color::FromHSB(rainbow2, 1.f, 1.f));
			log.color_line.PushBack(" bought a ", Color::FromHSB(rainbow3, 1.f, 1.f));
			log.color_line.PushBack(game_event->GetString("weapon"), Color::FromHSB(rainbow4, 1.f, 1.f));

			MISC::in_game_logger.AddLog(log);
		};

		void PlayerHurtListener::FireGameEvent(IGameEvent* game_event)
		{

			static float rainbow;
			static float rainbow2;
			static float rainbow3;
			static float rainbow4;
			rainbow += 0.001;
			rainbow2 += 0.005;
			rainbow3 += 0.010;
			rainbow4 += 0.015;
			if (rainbow > 1.f || rainbow2 > 1.f || rainbow3 > 1.f || rainbow4 > 1.f)
			{
				rainbow = 0.f;
				rainbow2 = 0.f;
				rainbow3 = 0.f;
				rainbow4 = 0.f;
			}

			if (!game_event)
				return;

			
			//FEATURES::RAGEBOT::resolver.ProcessSnapShots();
			auto local_player = m_pEntityList->GetClientEntity(m_pEngine->GetLocalPlayer());
			if (!local_player)
				return;

			auto attacker = m_pEntityList->GetClientEntity(m_pEngine->GetPlayerForUserID(game_event->GetInt("attacker")));
			if (!attacker)
				return;

			if (attacker != local_player)
				return;


			player_info_t player_info;
			m_pEngine->GetPlayerInfo(m_pEngine->GetPlayerForUserID(game_event->GetInt("userid")), &player_info);

			MISC::InGameLogger::Log log;	
			log.color_line.PushBack("[nnware] ", Color::FromHSB(rainbow, 1.f, 1.f)); //CColor(0, 191, 255, 255));
			log.color_line.PushBack("Hit ", Color::FromHSB(rainbow2, 1.f, 1.f));  // CColor(3, 127, 168, 255));
			log.color_line.PushBack(player_info.name, Color::FromHSB(rainbow3, 1.f, 1.f)); //CColor(3, 127, 168, 255));

			int hitgroup = game_event->GetInt("hitgroup");
			if (hitgroup > 0 && hitgroup <= 7)
			{
				log.color_line.PushBack(" in the ", Color::FromHSB(rainbow4, 1.f, 1.f)); //CColor(3, 127, 168, 255));
				log.color_line.PushBack(UTILS::GetHitgroupName(hitgroup), Color::FromHSB(rainbow, 1.f, 1.f)); //CColor(168, 3, 107, 255));
			}

			log.color_line.PushBack(" for ", Color::FromHSB(rainbow2, 1.f, 1.f)); //CColor(3, 127, 168, 255));
			log.color_line.PushBack(std::to_string(game_event->GetInt("dmg_health")), Color::FromHSB(rainbow3, 1.f, 1.f)); //CColor(168, 3, 107, 255));
			log.color_line.PushBack(" damage.", Color::FromHSB(rainbow4, 1.f, 1.f)); //CColor(3, 127, 168, 255));


			switch (Shonax::settingsxd.hitmarker_val)
			{
			case 0: break;
			case 1: PlaySoundA(pew, NULL, SND_ASYNC | SND_MEMORY); break;
			case 2: PlaySoundA(yourmad, NULL, SND_ASYNC | SND_MEMORY); break;
			case 3: m_pSurface->IPlaySound("buttons\\arena_switch_press_02.wav"); break;
			case 4: PlaySoundA(ohellothere, NULL, SND_ASYNC | SND_MEMORY); break;
			case 5: PlaySoundA(aimware, NULL, SND_ASYNC | SND_MEMORY); break;
			case 6: PlaySoundA(rifk7beep, NULL, SND_ASYNC | SND_MEMORY); break;
			case 7: PlaySoundA(bameWare, NULL, SND_ASYNC | SND_MEMORY); break;
			}

			MISC::in_game_logger.AddLog(log);
		};

